import react from "react";
import "./header.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faSearch,faHeart,faShoppingBasket } from '@fortawesome/free-solid-svg-icons';
const Header = () => {
  return (
    <header className="container">
      <div className="header">
        <div className="logo">
          <img src="/images/Logo-header.svg" alt="Logo" />
        </div>
        <button>
          <FontAwesomeIcon icon={faBars} />
          Katalog
        </button>
        <div className="input-btn"><input
            id=""
            class=""
            type="text"
            placeholder="Məhsulları axtarın..."
        />

        <div className="search"><FontAwesomeIcon icon={faSearch} /> </div>
        </div>


        <div className="sweet-buttons">
            <button className="fav"><FontAwesomeIcon icon={faHeart} /></button>
            <button  className="basket"><FontAwesomeIcon icon={faShoppingBasket} /></button>
            <button></button>
        </div>
      </div>
    </header>
  );
};

export default Header;
